import { IonModal } from "@ionic/react";
import { Card, Col, Container } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import FormLogin from "./FormLogin";


const ModalConfirm = () => {

  const {feha_nac='',number_phone='',puesto=''} = useSelector((state: any) => state.userInfo);
    const { statusModal = false } = useSelector((state: any) => state.effects);
    const dispatch = useDispatch();

    return <IonModal
        isOpen={statusModal}
        swipeToClose={false}
        backdropDismiss={false}
        onDidDismiss={()=>dispatch({type:'OFF_MODAL'})}
    >
            <Card.Title>Confirmar datos:</Card.Title>
            <Card.Body>
                <Container>
                    <Col>
                        <FormLogin />
                        <FormLogin />
                        <FormLogin />
                    </Col>
                </Container>
            </Card.Body>
    </IonModal>;
}

export default ModalConfirm;
